    <>
      <input
        type={type}
        name={name}
        placeholder={placeholder}
        value={value}
        onChange={onChange}
      />
      <style jsx>
        {`
          input {
            width: 250px;
            height: 35px;
            border-radius: 7px;

          }
        `}
      </style>
    </>
  );
};

export default Input;
